import React from 'react';
import './App.css';
import myntraLogo from './myntra.svg';

const AboutUs = () => {
    return (
        <div>
            <section className="about">
                <h1>About Us</h1>
                <p style={{}}>
                    Welcome to [Your Platform Name], the ultimate destination where influencers and brands come together to create magic!
                </p>
                <div className="about-info">
                    <div className="about-img">
                        <img src={myntraLogo} alt="myntralogo" />
                    </div>
                    <div>
                        <p> Who are we ?</p>
                        <p> At [Your Platform Name], we believe in the power of collaboration. Our platform is designed to bring influencers and companies together to create impactful marketing campaigns. Whether you're a brand looking to expand your reach or an influencer eager to showcase innovative products, we provide the tools and connections to make it happen.</p>
                    
                    </div>
                </div>
            </section>
        </div>
    );
}

export default AboutUs;
